import React from "react";
import { FeatureContainer } from "./FeactureElements";

export const Feacture = () => {
  return (
    <FeatureContainer>
      <h1>Pizza Of The Day</h1>
      <p>Truffle alfredo sauce topped with carat gold dust.</p>
    </FeatureContainer>
  );
};
